frUniDnaDataPath = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 2, 13, 1, 21), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2))).clone(namedValues=NamedValues(("dprsOnly", 0), ("dprsMcsOnly", 1), ("dprsMcsFirst", 2))).clone('dprsOnly')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDnaDataPath.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDnaDataPath.setDescription('This attribute specifies the data path to be used by Virtual Circuits on this interface. If the connection has a DirectCall component then the value can be overridden by the dataPath attribute of the DirectCall component. This value applies to the connection after data transfer state is reached. All the data and control trafic will be sent using this data path. If the provisioned dataPath is not available the connection is not established. The value of the dataPath is signalled by both ends of the connection. If this value is not the same at both ends dprsOnly is used for the duration of the connection. A virtual circuit connection is always established using dprsOnly even if this attribute is provisioned as some other value. dprsOnly - dynamic packet routing system is used dprsMcsOnly - dprs Multi-Service Cut-Through Switching path is used. dprsMcsFirst - dprs Multi-Service Cut-Through Switching path is used if it is available. If it is not avaliable dprsOnly is used.')
