if mibBuilder.loadTexts: frUniDnaCugType.setDescription('This attribute specifies the CUG type - the CUG is either a national CUG, or an international CUG. International closed user groups are usually established between DTEs for which there is an X.75 Gateway between; whereas national closed user groups are usually established between DTEs for which there is no X.75 Gateway between. (National CUGs cannot normally traverse an X.75 Gateway). If this attribute is set to national, then the CUG is a national CUG, in which case, the dnic should be left at its default value since it is not part of a national CUG. If this attribute is set to international, then the CUG is an international CUG, in which case, the dnic should be set appropriately as part of the CUG interlockCode.')
frUniDnaCugDnic = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 2, 2, 10, 1, 2), DigitString().subtype(subtypeSpec=ValueSizeConstraint(4, 4)).setFixedLength(4).clone(hexValue="30303030")).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDnaCugDnic.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDnaCugDnic.setDescription('This attribute specifies the dnic (Data Network ID Code) of the CUG by which packet networks are identified. This attribute is not applicable if the CUG is a national CUG, as specified by the CUG type attribute. There are usually 1 or 2 dnics assigned per country, for public networks. The U.S. is an exception where each BOC has a dnic. Also, a group of private networks can have its own dnic. dnic value is not an arbitrary number. It is assigned by international agreement and controlled by CCITT.')
frUniDnaCugInterlockCode = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 2, 2, 10, 1, 3), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535)).clone(65535)).setMaxAccess("readwrite")
