if mibBuilder.loadTexts: frUniDnaCugInterlockCode.setDescription("This attribute specifies the CUG identifier of a national or international CUG call. It is an arbitrary number and it also can be called CUG in some descriptions. Interfaces (DNA's) defined with this number can make calls to DNA's with the same interlockCode.")
frUniDnaCugPreferential = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 2, 2, 10, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("no", 0), ("yes", 1))).clone('no')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDnaCugPreferential.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDnaCugPreferential.setDescription("The attribute 'preferential', if set to yes indicates that this CUG is the SIMPLE CUG (as defined in ITU X.36 [10/96]), in which case it will be used during the call establishment phase if the DTE has not explicitly specified a CUG index in the call request packet. If set to no, then this CUG is not the SIMPLE CUG, but an instance of the SELECTABLE CUG. The attribute 'preferential' is set to no by CAS when a CUG instance is created. If only one CUG instance exists under a DNA, and if this CUG's attributes 'incCalls' and 'outCall' are both set to allowed, then this CUG instance can be changed to a SIMPLE CUG by setting the attribute 'preferential' to yes. If more than one CUG instances exist under a DNA, none of the CUGs can be set by the user as 'preferential'. Essentially, the attribute 'preferential' distinguishes a SIMPLE CUG from a SELECTABLE CUG. In the case of a FRUNI DNA with a single CUG instance, the CUG can be a SIMPLE CUG (preferential = yes) or the only instance of a SELECTABLE CUG (preferential = no).")
frUniDnaCugOutCalls = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 2, 2, 10, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("disallowed", 0), ("allowed", 1))).clone('allowed')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDnaCugOutCalls.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDnaCugOutCalls.setDescription("This attribute, if set to allowed indicates that outgoing calls (from the DTE into the network) can be made using this particular CUG. If set to a value of disallowed, then outgoing calls cannot be made using this CUG - such calls will be cleared by the local DCE. This attribute corresponds to the CCITT 'Outgoing Calls Barred' feature for CUGs in that outgoing calls are barred if this attribute is set to a value of disallowed.")
frUniDnaCugIncCalls = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 2, 2, 10, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("disallowed", 0), ("allowed", 1))).clone('allowed')).setMaxAccess("readwrite")
