if mibBuilder.loadTexts: frUniDlciQ933CallState.setDescription("This attribute specifies the Q.933 state of an SVC call. The value of this attribute for a PVC is always notApplicable. In the description that follows, 'local' refers to the user who has initiated the SETUP request, and 'remote' refers to the user to whom the local user wishes to connect. State description: In the null state, the network has neither received nor sent call setup requests for this DLCI. In the callInitiated state, the network has received a SETUP message from the local user. In the outgoingCallProceeding state, the network has sent a CALL PROCEEDING message to the local user in response to the SETUP message. In the callPresent state, the network has sent a SETUP message to the remote user. In the incomingCallProceeding state, the network has received a CALL PROCEEDING message from the remote user in response to a SETUP message. In the active state, either the network has sent a CONNECT message to the local user, or the network has received a CONNECT from the remote user. In the disconnectRequest state, the network has received a DISCONNECT message from the local user. In the disconnectIndication state, the network has sent a DISCONNECT to the local user. In the releaseRequest state, the network has sent out a RELEASE message to the local user.")
