if mibBuilder.loadTexts: frUniDlciDcNfaTable.setDescription("This is the i'th National facility required for this direct call. Within the provisioning system, the user specifies the facility code along with the facility parameters. The facility is represented internally as a hexadecimal string following the X.25 CCITT representation for facility data. Two explicit attributes discardPriority and pathSensitivity are created to replace H.01 and H.30 in the group VcsDirectCallOptionsProv of this file. The migrate escape here (DcComponent::migrateFaxEscape) propagates the old provisioning data under H.01 and H.30 into discardPriority and transferPriority. The rule of the above propagation are: 0 in H.01 is equivalent to discardPriority 0; 1 in H.01 is equivalent to discardPriority 1. And 0 in H.30 is equivalent to transferPriority throughput; 1 in H.30 is equivalent to pathSensitivity delay. Please refer to discardPriority and pathSensitivity for more information on how to use them.")
