if mibBuilder.loadTexts: frUniDlciVcFrdTable.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciVcFrdTable.setDescription('This group defines Frame Relay attributes collected by Frame Relay Vc. The purpose of Vc attributes is to aid end users and verification people to understand the Vc internal behavior. This is particularly useful when the network has experienced abnormality and we want to isolate problems and pinpoint trouble spots. Attributes are collected on a per Vc basis. Until a need is identified, statistics are not collected at a processor level. Each attribute is stored in a 32 bit field and is initialized to zero when a Vc enters into the data transfer state. When a PVC is disconnected and then connected again, the attributes will be reset. Attributes cannot be reset through other methods. Frame Relay Vc uses a best effort data packet delivery protocol and a different packet segmentation and combination methods from the General Vc. The Frame Relay Vc uses the same call setup and control mechanism (e.g. the support of non-flow control data packets) as in a General Vc. Most General Vc statistics and internal variables are used in a Frame Relay Vc and are displayed by software developers')
frUniDlciVcFrdEntry = MibTableRow((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 3, 12, 1), ).setIndexNames((0, "Nortel-Magellan-Passport-FrameRelayUniMIB", "frUniIndex"), (0, "Nortel-Magellan-Passport-FrameRelayUniMIB", "frUniDlciIndex"), (0, "Nortel-Magellan-Passport-FrameRelayUniMIB", "frUniDlciVcIndex"))
if mibBuilder.loadTexts: frUniDlciVcFrdEntry.setStatus('mandatory')
