frUniDlciSpRateEnforcement = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('on')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpRateEnforcement.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpRateEnforcement.setDescription('This attribute specifies whether rate enforcement is in effect for this user Data Link Connection on this Frame Relay interface. Turning on rate enforcement means that CIR and DE=1 traffic will be measured and enforced. Turning off rate enforcement means that all frames from the user will be accepted and no modifications to the frame with respect to the DE bit will be made.')
frUniDlciSpCommittedInformationRate = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 3), Gauge32().subtype(subtypeSpec=ValueRangeConstraint(0, 50000000)).clone(64000)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpCommittedInformationRate.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpCommittedInformationRate.setDescription('This attribute specifies the committed information rate (CIR) in bits per second (bit/s). When rateEnforcement is set to on, cir is the rate at which the network agrees to transfer information under normal conditions. This rate is measured over a measurement interval (t) that is determined internally based on CIR and the committed burst size (Bc). An exception to this occurs when CIR is provisioned to be zero, in which case the measurement interval (t) must be provisioned explicitly. This attribute is ignored when rateEnforcement is off. If rateEnforcement is on and this attribute is 0, Bc must also be 0.')
frUniDlciSpCommittedBurstSize = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 4), Gauge32().subtype(subtypeSpec=ValueRangeConstraint(0, 50000000)).clone(64000)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpCommittedBurstSize.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpCommittedBurstSize.setDescription('This attribute specifies the committed burst size (Bc) in bits. bc is the amount of data that a network agrees to transfer under normal conditions over a measurement interval (t). Data marked DE=1 is not accounted for in Bc. This attribute is ignored when rateEnforcement is off. If rateEnforcement is on and this attribute is 0, cir must also be 0.')
frUniDlciSpExcessBurstSize = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 5), Gauge32().subtype(subtypeSpec=ValueRangeConstraint(0, 50000000))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpExcessBurstSize.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpExcessBurstSize.setDescription('This attribute specifies the excess burst size (Be) in bits. Be is the amount of uncommitted data that the network will attempt to deliver over measurement interval T. Data marked DE=1 by the user or by the network is accounted for here. CIR, Bc, and Be cannot all be zero when rateEnforcement is on.')
frUniDlciSpMeasurementInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 6), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 25500))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpMeasurementInterval.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpMeasurementInterval.setDescription('When cir and bc are zero and rateEnforcement is on, this attribute must be provisioned to specify the time interval (in milliseconds) over which rates and burst sizes are measured. When cir and bc are non-zero, the time interval is internally calculated and is not shown. In that situation, this field is ignored, and is not representative of the time interval. This attribute is ignored when rateEnforcement is off, or when cir and bc are non-zero. If rateEnforcement is on and both cir and bc are zero, this field must be non-zero.')
frUniDlciSpRateAdaptation = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("off", 0), ("on", 1), ("eirOnly", 2), ("cirProportionate", 3))).clone('off')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpRateAdaptation.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpRateAdaptation.setDescription('This attribute specifies whether rate adaptation is in effect for this user Data Link Connection on this Frame Relay interface. Rate adaptation is a feature that, in periods of congestion, adapts the rate at which the user is allowed to send data into the network to that which the network is able to handle at that time. This pro-active measure of handling congestion optimizes network resources by causing the ingress to discard frames that would otherwise be discarded in the network. If this attribute is set to on, then, at the onset of congestion, the excess information rate (EIR) is reduced to a very low rate. If congestion persists, then the allowed CIR is reduced geometrically by 25% of the current value at that time. The minimum to which CIR can be reduced is 1/16th (6.25%) of the provisioned value. As congestion alleviates, CIR is increased linearly by 6.25% of the provisioned value specified in committedInformationRate. If set to eirOnly, then rate adaptation will only apply to the excess information rate (EIR). At the onset of congestion, the allowed EIR is reduced by 25% of its provisioned value. If congestion persists, EIR is reduced geometrically by 25% of the current value at that time. As congestion alleviates, EIR is gradually increased linearly by 6.25% of the provisioned EIR. If set to cirProportionate, then rate adaptation will also only apply to the excess information rate (EIR). At the onset of congestion the initial allowed EIR is set to a multiple of the provisioned CIR. If congestion persists, the allowed EIR is reduced geometrically by 25% of the current value at that time. As congestion alleviates, EIR is gradually increased linearly by 6.25% of the provisioned EIR. Note that the allowed EIR may be set higher than the provisioned EIR, since it is calculated initially using another parameter, the provisioned CIR. If the allowed EIR at the moment is higher than the provisioned EIR, then the provisioned EIR is used instead. This attribute can only be set to on eirOnly or cirProportionate if rateEnforcement is turned on.')
frUniDlciSpAccounting = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 8), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('on')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpAccounting.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpAccounting.setDescription('This attribute specifies whether accounting data collection and record generation is turned on at this DLCI. For accounting data collection and record generation to be turned on, the accountingOn bit and at least one of the accountCollection bits in the DataNetworkAddress component must be set to on.')
frUniDlciSpRaSensitivity = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 9), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 20)).clone(7)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpRaSensitivity.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpRaSensitivity.setDescription('This attribute specifies the sensitivity of the rate adaptation system. A higher number indicates a higher sensitivity and therefore a quicker reaction time to network conditions. A quicker reaction time allows the network to discard frames at the access and protect network resources, but can lead to false alarms and a greater fluctuation of the allowed rate. A higher setting therefore tends to favour the protection of the network over the allowed throughput of the user. A lower number indicates a lower sensitivity and therefore a slower reaction to network conditions. A slower reaction time results in a greater amount of user traffic allowed into the network, but can lead to a waste of network bandwidth since the traffic may be discarded at the congested resource. A lower setting therefore tends to favour the allowed throughput of the user over the protection of the network. This attribute is applicable for adapting EIR when rateAdaptation is eirOnly or cirProportionate, or CIR when rateAdaptation is on. This attribute is ignored if rateAdaptation is turned off.')
frUniDlciSpUpdateBCI = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 5, 4, 11, 1, 10), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('off')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniDlciSpUpdateBCI.setStatus('mandatory')
if mibBuilder.loadTexts: frUniDlciSpUpdateBCI.setDescription('This attribute specifies whether internal Backward Congestion Indication (BCI) bits will report congestion external to the Passport network, as communicated through incoming BECN bits. If updateBCI is set to on, then BCI bits for incoming frames will be set if the BECN on the frame is set. If updatBCI is set to off, then incoming BECN bits will have no effect. Setting updateBCI on for a DLCI means that the remote end of the DLCI, which is specified by the remotedna and remotedlci attributes of the dc component of the dlci, may perform Rate Adaptation using the flow of incoming BECN bits, in addition to internal Passport congestion management systems. If the rateAdaptation attribute of the remote dlci is provisioned as eirOnly, cirProportionate, or on, then congestion from another network connected to a Passport network may trigger dynamic congestion management. If the rateAdaptation attribute of the remote dlci is provisioned to off, then the setting of updateBCI attribute here will have no effect..')
