frUniSigX213IeHandling = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 6, 12, 1, 17), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("notSupported", 0), ("proprietary", 1))).clone('notSupported')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniSigX213IeHandling.setStatus('mandatory')
if mibBuilder.loadTexts: frUniSigX213IeHandling.setDescription('The x213IeHandling attribute specifies how Frame Relay handles the X.213 Priority IE when it is in the Q.933 setup message. When the attribute is set to notSupported, the X.213 Priority IE will not be recognized in the setup message. A Q.933 status message will be sent to the calling DTE, with the indication that an unrecognized IE was encountered. The call setup then proceeds as normal, and the X.213 Priority IE does not appear in the setup message at the called end. When the attribute is set to proprietary, and the X.213 Priority IE is present in the Q.933 setup message, it will be recognized. If there is no Frame Transfer Priority IE in the setup message, the first data byte of the X.213 Priority IE is used to select the transfer and discard priority values for the connection and the X.213 Priority IE is signaled to the called end in the setup message. If the Frame Transfer Priority IE is present in the Q.933 setup message, its value is used to select the transfer priority, the discard priority is taken from the FRUNI Dna component, and the X.213 Priority IE is ignored. Refer to the related Application Note for further details before setting the attribute value to proprietary.')
frUniSigRaSensitivity = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 6, 12, 1, 18), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 20)).clone(7)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniSigRaSensitivity.setStatus('mandatory')
if mibBuilder.loadTexts: frUniSigRaSensitivity.setDescription("This attribute specifies the sensitivity of the rate adaptation system for Svc's on this interface. Since this attribute is in the Sig Component of an FR Uni component, all SVC DLCI's created for this FR Uni Service will take the raSensitivity attribute provisioned here. A higher number indicates a higher sensitivity and therefore a quicker reaction time to network conditions. A quicker reaction time allows the network to discard frames at the access and protect network resources, but can lead to false alarms and a greater fluctuation of the allowed rate. A higher setting therefore tends to favour the protection of the network over the allowed throughput of the user. A lower number indicates a lower sensitivity and therefore a slower reaction to network conditions. A slower reaction time results in a greater amount of user traffic allowed into the network, but can lead to a waste of network bandwidth since the traffic may be discarded at the congested resource. A lower setting therefore tends to favour the allowed throughput of the user over the protection of the network. This attribute is applicable for adapting EIR when rateAdaptation is eirOnly or cirProportionate, or CIR when rateAdaptation is on. This attribute is ignored if rateAdaptation is turned off.")
frUniSigUpdateBCI = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 6, 12, 1, 19), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('off')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniSigUpdateBCI.setStatus('mandatory')
if mibBuilder.loadTexts: frUniSigUpdateBCI.setDescription('This attribute specifies whether internal Backward Congestion Indication (BCI) bits will report congestion external to the Passport network, as communicated through incoming BECN bits. If updateBCI is set to on, then BCI bits for incoming frames will be set if the BECN on the frame is set. If updatBCI is set to off, then incoming BECN bits will have no effect. Setting updateBCI on for a DLCI means that the remote end of the DLCI, which is specified by the remotedna and remotedlci attributes of the dc component of the dlci, may perform Rate Adaptation using the flow of incoming BECN bits, in addition to internal Passport congestion management systems. If the rateAdaptation attribute of the remote dlci is provisioned as eirOnly, cirProportionate, or on, then congestion from another network connected to a Passport network may trigger dynamic congestion management. If the rateAdaptation attribute of the remote dlci is provisioned to off, then the setting of updateBCI attribute here will have no effect..')
frUniSigDefaultLocCheck = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 71, 6, 12, 1, 20), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('on')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: frUniSigDefaultLocCheck.setStatus('mandatory')
if mibBuilder.loadTexts: frUniSigDefaultLocCheck.setDescription("This attribute specifies whether Passport needs to check the location of Cause IE in a Release or a Disc message issued by local DTE. If this bit is set to on, then Passport will check the location of Cause IE issued by the local DTE and overwrite it by 'user'. If it is set to off, then Passport will not check the location in Cause IE.")
